import './TradeItem.css';

function TradeItem() {
  return (
    <div className='trade-item'>
      <h2 className='trade-item'>Ticker</h2>
      <h2 className='trade-item'>Date</h2>
      <h2 className='trade-item'>PnL %</h2>
      <h2 className='trade-item'>PnL Amount</h2>
    </div>
  );
}

export default TradeItem;
